import React from 'react'
import EventsList from '../components/EventsList'

const EVENTS =[{
  id:'e1',
  title: 'first event',
  imgage:'https://th.bing.com/th/id/OIP.0HOj5_E-dLZfxTaWseLe0gHaE7?w=262&h=180&c=7&r=0&o=5&pid=1.7',
  date: '22-02-2024'

},
{
id:'e2',
title: 'Second event',
imgage:'https://th.bing.com/th/id/OIP.0HOj5_E-dLZfxTaWseLe0gHaE7?w=262&h=180&c=7&r=0&o=5&pid=1.7',
date: '22-02-2024'

},
]
function EventsPage() {
  return (
    <div><EventsList events={EVENTS}/></div>
  )
}

export default EventsPage
